        public int LengthOfLongestSubstring(string s)
        {
            int maxlength = 0;
            int len = s.Length;
            int p1 = 0;

            while (p1 < len)
            {
                int cur_length = 1;
                if (cur_length > maxlength)
                    maxlength = cur_length;
                List<char> l = new List<char>();
                int p2 = p1+1;
                l.Add(s[p1]);
                while (p2 < s.Length && !l.Contains(s[p2]))
                {
                    l.Add(s[p2]);
                    cur_length++;
                    if (cur_length > maxlength)
                        maxlength = cur_length;
                    p2++;
                }

                p1++;
            }
            

            return maxlength;
        }

        public int LengthOfLongestSubstring2(string s)
        {
            int maxlengh = 0;
            for (int i = 0; i < s.Length; i++)
            {
                Console.WriteLine("Finding all substrings for : " + s.Substring(i));

                for (int j = 0; j <= s.Length - i; j++)
                {
                    string t = s.Substring(i, j);
                    var dict = t.GroupBy(x => x).Select(g => new { Character = g.Key, Count = g.Count() }).ToDictionary(p => p.Character, p => p.Count);
                    if (dict.Where(d => d.Value > 1).Count() > 0)
                    {
                        break;
                    }
                    else
                    {
                        if (t.Length > maxlengh)
                        {
                            maxlengh = t.Length;
                            Console.Write("\t**");
                        }
                    }
                    Console.WriteLine("\t" + s.Substring(i, j));
                }

            }
            return maxlengh;
        }
